+pub mod stamp; pub trait Task: Clone + Eq + Hash + Debug { type Output: Clone + Eq + Debug; fn execute<C: Context<Self>>(&self, context: &mut C) -> Self::Output; } Note that this module is declared pub, as users of the library should be able to construct stampers. File stamps Create the src/stamp.rs file and add: use std::fmt::Debug;
use std::io;
use std::path::Path;
use std::time::SystemTime; use crate::fs::metadata; #[derive(Clone, Eq, PartialEq, Debug)]
pub enum FileStamper { Exists, Modified,
} impl FileStamper { pub fn stamp(&self, path: impl AsRef<Path>) -> Result<FileStamp, io::Error> { match self { FileStamper::Exists => { Ok(FileStamp::Exists(path.as_ref().try_exists()?)) } FileStamper::Modified => { let Some(metadata) = metadata(path)? else { return Ok(FileStamp::Modified(None)); }; Ok(FileStamp::Modified(Some(metadata.modified()?))) } } }
} #[derive(Clone, Eq, PartialEq, Debug)]
pub enum FileStamp { Exists(bool), Modified(Option<SystemTime>),
} We're implementing FileStamper as an enum for simplicity. A FileStamper has a single method stamp which takes something that can be dereferenced to a path, and produces a FileStamp or an error if creating the stamp failed. For now, we implement only two kinds of file stampers: Exists and Modified. The Exists stamper just returns a boolean indicating whether a file exists. It can be used to create a file dependency where a task behaves differently based on whether a file exists or not. The Modified stamper returns the last modification date if the file exists, or None if the file does not exist. We derive Eq for stamps so that we can compare them. Equal stamps indicate a consistent dependency, unequal indicates inconsistent. We also derive Eq for stampers, because the stamper of a dependency could change, making the dependency inconsistent. Task output stamps We implement task output stampers in a similar way. Add to src/stamp.rs: #[derive(Clone, Eq, PartialEq, Debug)]
pub enum OutputStamper { Inconsequential, Equals,
} impl OutputStamper { pub fn stamp<O>(&self, output: O) -> OutputStamp<O> { match self { OutputStamper::Inconsequential => OutputStamp::Inconsequential, OutputStamper::Equals => OutputStamp::Equals(output), } }
} #[derive(Clone, Eq, PartialEq, Debug)]
pub enum OutputStamp<O> { Inconsequential, Equals(O),
} impl<O> OutputStamp<O> { pub fn as_ref(&self) -> OutputStamp<&O> { match self { OutputStamp::Inconsequential => OutputStamp::Inconsequential, OutputStamp::Equals(o) => OutputStamp::Equals(o), } }
} The Inconsequential stamper simply ignores the output and always returns the same stamp (thus is always equal). It can be used to create a task dependency where we are interested in some side effect of a task, but don't care about its output. The Equals stamper simply wraps the output of a task, so the stamp is equal when the output is equal. Output stamps are generic over the task output type O. Trait bounds and derive macros Because O is used in the enum, the derive attributes on OutputStamp create bounds over O. Thus, OutputStamp is only Clone when O is Clone, OutputStamp is only Clone when O is Clone, and so forth. Because we declared Task::Output with bound Clone + Eq + Debug, we can be sure that OutputStamp is always Clone, Eq, and Debug. User definable stamps FileStamper and OutputStamper could also be a trait which would allow users of the library to implement their own stampers. For simplicity, we do not explore that option in this tutorial. If you feel adventurous, you could try to implement this after you've finished the tutorial. Do note that this introduces a lot of extra generics and trait bounds everywhere, which can be a bit cumbersome. Tests Finally, we write some tests. Add to src/stamp.rs: #[cfg(test)]
mod test { use std::fs; use tempfile::{NamedTempFile, TempPath}; use super::*; #[test] fn test_exists_file_stamper() { let stamper = FileStamper::Exists; let path = create_temp_path(); let stamp = stamper.stamp(&path).expect("failed to stamp"); assert_eq!(stamp, stamper.stamp(&path).expect("failed to stamp")); fs::remove_file(&path).expect("failed to delete temporary file"); assert_ne!(stamp, stamper.stamp(&path).expect("failed to stamp")); } #[test] fn test_modified_file_stamper() { let stamper = FileStamper::Modified; let path = create_temp_path(); let stamp = stamper.stamp(&path).expect("failed to stamp"); assert_eq!(stamp, stamper.stamp(&path).expect("failed to stamp")); fs::write(&path, format!("{:?}", stamp)).expect("failed to write to temporary file"); assert_ne!(stamp, stamper.stamp(&path).expect("failed to stamp"), "modified stamp is equal after modifying file"); fs::remove_file(&path).expect("failed to delete temporary file"); assert_ne!(stamp, stamper.stamp(&path).expect("failed to stamp"), "modified stamp is equal after removing file"); } #[test] fn test_inconsequential_output_stamper() { let stamper = OutputStamper::Inconsequential; let stamp = stamper.stamp(&1); assert_eq!(stamp, stamper.stamp(&1)); assert_eq!(stamp, stamper.stamp(&2)); } #[test] fn test_equals_output_stamper() { let stamper = OutputStamper::Equals; let stamp = stamper.stamp(&1); assert_eq!(stamp, stamper.stamp(&1)); assert_ne!(stamp, stamper.stamp(&2)); } fn create_temp_path() -> TempPath { NamedTempFile::new().expect("failed to create temporary file").into_temp_path() }
} We test file stamps by creating a stamp, changing the file, creating a new stamp, and then compare the stamps. We test task output stamps by just passing a different output value to the stamp function, and then compare the stamps. Run cargo test to confirm the stamp implementation.

