+
+ fn require_task_with_stamper(&mut self, task: &T, stamper: OutputStamper) -> T::Output;
+ fn require_file_with_stamper<P: AsRef<Path>>(&mut self, path: P, stamper: FileStamper) -> Result<Option<File>, io::Error>;
+
+ fn default_output_stamper(&self) -> OutputStamper { OutputStamper::Equals }
+ fn default_file_stamper(&self) -> FileStamper { FileStamper::Modified } } We add the require_task_with_stamper and require_file_with_stamper methods which allow passing in a stamper. We add default implementations for the require_task and require_file methods which pass in a default stamper. The defaults are provided by default_output_stamper and default_file_stamper which can be overridden by the context implementation. Update NonIncrementalContext in src/context/non_incremental.rs to implement the new methods: use std::io; use std::path::Path; use crate::{Context, Task}; use crate::fs::open_if_file;
+use crate::stamp::{FileStamper, OutputStamper}; pub struct NonIncrementalContext; impl<T: Task> Context<T> for NonIncrementalContext {
- fn require_task(&mut self, task: &T) -> T::Output {
+ fn require_task_with_stamper(&mut self, task: &T, _stamper: OutputStamper) -> T::Output { task.execute(self) }
- fn require_file<P: AsRef<Path>>(&mut self, path: P) -> Result<Option<File>, io::Error> {
+ fn require_file_with_stamper<P: AsRef<Path>>(&mut self, path: P, _stamper: FileStamper) -> Result<Option<File>, io::Error> { let file = open_if_file(&path)?; Ok(file) } } We just ignore the stampers in NonIncrementalContext, as they are only needed for incrementality. Run cargo test to confirm everything still works.

