Add the dependency module to src/lib.rs: use stamp::{FileStamper, OutputStamper}; mod context; mod fs; pub mod stamp;
+mod dependency; pub trait Task: Clone + Eq + Hash + Debug { type Output: Clone + Eq + Debug; fn execute<C: Context<Self>>(&self, context: &mut C) -> Self::Output; } This module is not public, as users of the library should not construct dependencies. They should only create stampers, which are passed to dependencies via the Context. File dependencies Create the src/dependency.rs file and add: use std::fmt::Debug;
use std::fs::File;
use std::io;
use std::path::PathBuf; use crate::{Context, Task};
use crate::fs::{metadata, open_if_file};
use crate::stamp::{FileStamp, FileStamper, OutputStamp, OutputStamper}; #[derive(Clone, Eq, PartialEq, Debug)]
pub struct FileDependency { pub path: PathBuf, pub stamper: FileStamper, pub stamp: FileStamp,
} impl FileDependency { pub fn new(path: impl Into<PathBuf>, stamper: FileStamper) -> Result<(Self, Option<File>), io::Error> { let path = path.into(); let stamp = stamper.stamp(&path)?; let file = open_if_file(&path)?; let dependency = FileDependency { path, stamper, stamp }; Ok((dependency, file)) } /// Checks whether this file dependency is inconsistent, returning: /// - `Ok(Some(stamp))` if this dependency is inconsistent (with `stamp` being the new stamp of the dependency), /// - `Ok(None)` if this dependency is consistent, /// - `Err(e)` if there was an error checking this dependency for consistency. pub fn is_inconsistent(&self) -> Result<Option<FileStamp>, io::Error> { let new_stamp = self.stamper.stamp(&self.path)?; if new_stamp == self.stamp { Ok(None) } else { Ok(Some(new_stamp)) } }
} A FileDependency stores the path the dependency is about, the stamper used to create a stamp for this dependency, and the stamp that was created at the time the file dependency was made. The FileDependency::new function also returns the opened file if it exists, so that users of this function can read from the file without having to open it again. A file dependency is inconsistent when the stored stamp is not equal to a stamp that we create at the time of checking, implemented in FileDependency::is_inconsistent. For example, if we created a file dependency (with modified stamper) for a file that was modified yesterday, then modify the file, and then call is_inconsistent on the file dependency, it would return Some(new_stamp) indicating that the dependency is inconsistent. We implement an is_inconsistent method here instead of an is_consistent method, so that we can return the changed stamp when the dependency is inconsistent, which we will use for debug logging purposes later. Creating and checking a file dependency can fail due to file operations failing (for example, cannot access the file), so we propagate those errors. Task dependencies Task dependencies are implemented in a similar way. Add to src/dependency.rs: #[derive(Clone, Eq, PartialEq, Debug)]
pub struct TaskDependency<T, O> { pub task: T, pub stamper: OutputStamper, pub stamp: OutputStamp<O>,
} impl<T: Task> TaskDependency<T, T::Output> { pub fn new(task: T, stamper: OutputStamper, output: T::Output) -> Self { let stamp = stamper.stamp(output); Self { task, stamper, stamp } } /// Checks whether this task dependency is inconsistent, returning: /// - `Some(stamp)` if this dependency is inconsistent (with `stamp` being the new stamp of the dependency), /// - `None` if this dependency is consistent. pub fn is_inconsistent<C: Context<T>>(&self, context: &mut C) -> Option<OutputStamp<T::Output>> { let output = context.require_task(&self.task); let new_stamp = self.stamper.stamp(output); if new_stamp == self.stamp { None } else { Some(new_stamp) } }
} A TaskDependency stores the task the dependency is about, along with its stamper and stamp that is created when the dependency is created. Task dependencies are generic over the type of tasks T, and their type of outputs O. Trait bounds on structs We chose not to put a Task trait bound on TaskDependency, and instead put the bound on the impl. There are several up and downsides to that should be considered when making such a decision. The main upside for putting the Task bound on the TaskDependency struct, is that we can leave out O and use OutputStamp<T::Output> as the type of the stamp field. This cuts down a generic parameter, which reduces boilerplate. The downside is that we need to then put the Task bound on every struct that uses TaskDependency, which increases boilerplate. In this case, we chose not to put the trait bound on the struct to prevent that trait bound from bubbling up into other structs that use TaskDependency, as it would need to appear in almost every struct in the library. A task dependency is inconsistent if, after recursively checking it, its stamp has changed, implemented in TaskDependency::is_inconsistent. Usually, this will be using the Equals task output stamper, so a task dependency is usually inconsistent when the output of the task changes. Because we need to recursively check the task, TaskDependency::is_inconsistent requires a context to be passed in. Dependency enum Finally, we create a Dependency enum that abstracts over these two kinds of dependencies. Add to src/dependency.rs: #[derive(Clone, Eq, PartialEq, Debug)]
pub enum Dependency<T, O> { RequireFile(FileDependency), RequireTask(TaskDependency<T, O>),
} #[derive(Clone, Eq, PartialEq, Debug)]
pub enum InconsistentDependency<O> { File(FileStamp), Task(OutputStamp<O>),
} impl<T: Task> Dependency<T, T::Output> { /// Checks whether this dependency is inconsistent, returning: /// - `Ok(Some(stamp))` if the dependency is inconsistent (with `stamp` being the new stamp of the dependency), /// - `Ok(None)` if the dependency is consistent, /// - `Err(e)` if there was an error checking the dependency for consistency. pub fn is_inconsistent<C: Context<T>>(&self, context: &mut C) -> Result<Option<InconsistentDependency<T::Output>>, io::Error> { let option = match self { Dependency::RequireFile(d) => d.is_inconsistent()? .map(|s| InconsistentDependency::File(s)), Dependency::RequireTask(d) => d.is_inconsistent(context) .map(|s| InconsistentDependency::Task(s)), }; Ok(option) }
} Dependency just merges the two kinds of dependencies and provides an is_inconsistent method that calls the corresponding method. This will make it easier to write a dependency graph implementation later. We return the changed stamp here as well for debug logging later. We wrap the changed stamp in an InconsistentDependency enum, and map to the correct variant if there is an inconsistency. Because Dependency can store a TaskDependency, we need to propagate the T and O generics. Likewise, InconsistentDependency propagates the O generic for OutputStamp. User definable dependencies Like with stampers, Dependency could also be a trait to allow users of the library to define their own dependencies. However, as we will see later, these dynamic dependencies also require validation, and I am unsure how such a Dependency trait should look. Therefore, we don't have an appendix on how to implement this. But, if you have an idea on how to this nicely (after you've completed this tutorial), please get in touch! Tests As usual, we write some tests to confirm the behaviour. Add tests to src/dependency.rs: #[cfg(test)]
mod test { use std::fs; use std::io::Read; use tempfile::{NamedTempFile, TempPath}; use crate::context::non_incremental::NonIncrementalContext; use super::*; #[derive(Clone, PartialEq, Eq, Hash, Debug)] struct ReadStringFromFile(PathBuf); impl Task for ReadStringFromFile { type Output = String; fn execute<C: Context<Self>>(&self, context: &mut C) -> Self::Output { let mut string = String::new(); let file = context.require_file(&self.0) .expect("failed to require file"); if let Some(mut file) = file { file.read_to_string(&mut string) .expect("failed to read from file"); }; string } } #[test] fn test_file_dependency_consistency() { let mut context = NonIncrementalContext; let path = create_temp_path(); fs::write(&path, "test1") .expect("failed to write to file"); let (file_dependency, _) = FileDependency::new(&path, FileStamper::Modified) .expect("failed to create file dependency"); let dependency: Dependency<ReadStringFromFile, String> = Dependency::RequireFile(file_dependency.clone()); assert!(file_dependency.is_inconsistent().expect("failed to check for inconsistency").is_none()); assert!(dependency.is_inconsistent(&mut context).expect("failed to check for inconsistency").is_none()); fs::write(&path, "test2") .expect("failed to write to file"); assert!(file_dependency.is_inconsistent().expect("failed to check for inconsistency").is_some()); assert!(dependency.is_inconsistent(&mut context).expect("failed to check for inconsistency").is_some()); } #[test] fn test_task_dependency_consistency() { let mut context = NonIncrementalContext; let path = create_temp_path(); fs::write(&path, "test1") .expect("failed to write to file"); let task = ReadStringFromFile(path.to_path_buf()); let output = context.require_task(&task); let task_dependency = TaskDependency::new(task.clone(), OutputStamper::Equals, output); let dependency = Dependency::RequireTask(task_dependency.clone()); assert!(task_dependency.is_inconsistent(&mut context).is_none()); assert!(dependency.is_inconsistent(&mut context).expect("failed to check for inconsistency").is_none()); fs::write(&path, "test2") .expect("failed to write to file"); assert!(task_dependency.is_inconsistent(&mut context).is_some()); assert!(dependency.is_inconsistent(&mut context).expect("failed to check for inconsistency").is_some()); } fn create_temp_path() -> TempPath { NamedTempFile::new().expect("failed to create temporary file").into_temp_path() }
} We test a file dependency by asserting that is_inconsistent returns Some after changing the file. Testing task dependencies requires a bit more work. We create task ReadStringFromFile that reads a string from a file, and then returns that string as output. We require the task to get its output ("test1"), and create a task dependency with it. Then, we change the file and check consistency of the task dependency. That recursively requires the task, the context will execute the task, and the task now returns ("test2"). Since we use the Equals output stamper, and "test1" does not equal "test2", the dependency is inconsistent and returns a stamp containing "test2". Note that we are both testing the specific dependencies (FileDependency and TaskDependency), and the general Dependency. Note Normally, a task such as ReadStringFromFile shound return a Result<String, io::Error>, but for testing purposes we are just using panics with expect. In the file dependency case, using Dependency requires an explicit type annotation because there is no task to infer the type from. We just use Dependency<ReadStringFromFile, String> as the type, and this is fine even though we don't use ReadStringFromFile in that test, because the Dependency::RequireFile variant does not use those types. Run cargo test to confirm everything still works. You will get some warnings about unused things, but that is ok as we will use them in the next section.

