Now we will implement Store to keep track of the dependency graph, and TopDownContext for top-down incremental building. We will start with parts of Store, then parts of TopDownContext, and will go back and forth between them to implement the necessary parts. To do incremental building, we need to keep track of all files, tasks, their dependencies, and task outputs. This will be the responsibility of Store. The TopDownContext and future context implementations will use methods on Store to request and update this data. In other words, Store encapsulates this data. Writing a dependency graph data structure is outside of the scope of this tutorial, so we will be using the pie_graph library which we prepared exactly for this use case. The graph from this library is a directed acyclic graph (DAG), meaning that edges are directed and there may be no cycles in edges, as that would prohibit topological orderings. Graph library The pie_graph library is a modified version of the great incremental-topo library which implements incremental topological ordering: it keeps the topological ordering up-to-date incrementally while nodes and edges are added and removed. That is exactly what we need, as dynamic dependencies prevents us from calculating the topological ordering in one go, and calculating the topological ordering after every task execution is prohibitively expensive. The implementation in the incremental-topo library is based on a paper by D. J. Pearce and P. H. J. Kelly that describes several dynamic topological sort algorithms for directed acyclic graphs. Add the pie_graph dependency to Cargo.toml: Store basics Add the store module to src/lib.rs: This module is not public, as users of the library should not interact with the store. Create the src/store.rs file and add the following to get started: use std::collections::HashMap;
use std::hash::BuildHasher;
use std::path::{Path, PathBuf}; use pie_graph::{DAG, Node}; use crate::dependency::Dependency;
use crate::Task; pub type TaskNode = Node;
pub type FileNode = Node; pub struct Store<T, O> { graph: DAG<NodeData<T, O>, Option<Dependency<T, O>>>, task_to_node: HashMap<T, TaskNode>, file_to_node: HashMap<PathBuf, FileNode>,
} #[derive(Debug)]
pub enum NodeData<T, O> { Task { task: T, output: Option<O>, }, File(PathBuf),
} impl<T: Task> Default for Store<T, T::Output> { fn default() -> Self { Self { graph: DAG::with_default_hasher(), task_to_node: HashMap::default(), file_to_node: HashMap::default(), } }
} impl<T: Task> Store<T, T::Output> { /// Gets the node for `task`, or creates a node by adding it to the dependency graph. pub fn get_or_create_task_node(&mut self, task: &T) -> TaskNode { if let Some(node) = self.task_to_node.get(task) { *node } else { let node = self.graph.add_node(NodeData::Task { task: task.clone(), output: None, }); self.task_to_node.insert(task.clone(), node); node } } /// Gets the task for `node`, panicking if `node` was not found in the dependency graph or if `node` is a file. pub fn get_task(&self, node: &TaskNode) -> &T { let data = self.graph.get_node_data(node) .expect("node should exist in dependency graph"); match data { NodeData::Task { task, .. } => task, _ => panic!("node should be a task node") } } /// Gets the file node for `path`, or creates a node by adding it to the dependency graph. pub fn get_or_create_file_node(&mut self, path: impl AsRef<Path>) -> FileNode { let path = path.as_ref(); if let Some(file_node) = self.file_to_node.get(path) { *file_node } else { let node = self.graph.add_node(NodeData::File(path.to_path_buf())); self.file_to_node.insert(path.to_path_buf(), node); node } } /// Gets the path for `node`, panicking if `node` was not found in the dependency graph or if `node` is a task. #[inline] pub fn get_file_path(&self, node: &FileNode) -> &PathBuf { let data = self.graph.get_node_data(node) .expect("node should exist in dependency graph"); match data { NodeData::File(path) => path, _ => panic!("node should be a file node") } } /// Checks whether task `node` has an output. Returns `false` if `node` does not have an output , if `node` does not /// exist in the dependency graph, or if `node` is a file. #[inline] pub fn task_has_output(&self, node: &TaskNode) -> bool { if let Some(NodeData::Task { output: Some(_), .. }) = self.graph.get_node_data(node) { true } else { false } } /// Gets the output for task `node`, panicking if `node` was not found in the dependency graph, if `node` is a file, /// or if the task has no output. #[inline] pub fn get_task_output(&self, node: &TaskNode) -> &T::Output { let data = self.graph.get_node_data(node) .expect("node should exist in dependency graph"); match data { NodeData::Task { output, .. } => output.as_ref().expect("task should have an output"), _ => panic!("node should be a task node") } } /// Sets the output for task `node` to `new_output`. Does nothing if task `node` does not exist in the dependency /// graph. #[inline] pub fn set_task_output(&mut self, node: &TaskNode, new_output: T::Output) { if let Some(NodeData::Task { output, .. }) = self.graph.get_node_data_mut(node) { output.replace(new_output); } }
} The Store is generic over tasks T and their outputs O, like we have done before with Dependency. The DAG type from pie_graph represents a DAG with nodes and edges, and data attached to those nodes and edges. The first generic argument to DAG is the type of data to attach to nodes, which is NodeData<T, O> in our case. The second argument is the type of data to attach to edges, which is Option<Dependency<T, O>>, using the Dependency enum we defined earlier. We will dive deeper into why the Option is needed here later. A node in DAG is represented by a Node, which is a transparent identifier (sometimes called a handle) that points to the node and its data. The nodes in our graph are either tasks or files. To make our code a bit more explicit about when we expect a task node or a file node, we create the TaskNode and FileNode type aliases. Note that these are just aliases, they are not strongly typed, meaning that we can pass a Node (which could be a file node) where we expect a TaskNode, so this is just for readability. Because DAG works with these transparent Node identifiers, but we work with tasks of type T and file paths represented by PathBuf, we need to map between these things. The get_or_create_task_node and get_task_by_node methods show how we do this mapping for tasks. When we want to go from a task T to a TaskNode, either we have already added this task to the graph and want to get the TaskNode for it, or we have not yet added it to the graph yet and should add it. The former is handled by the if branch in get_or_create_task_node, where we just retrieve the TaskNode from the task_to_node hash map. The latter is handled by the else branch where we add the node to the graph with graph.add_node which attaches the NodeData::Task data to the node, and then returns a TaskNode which we insert into the task_to_node map. The TaskNode can then be used to query the attached data, to add or remove dependency edges, or to remove the node from the graph. To go from a TaskNode to a task T, we ask the graph for the attached data of the node and retrieve the task from it in get_task. We use expect and panic! here because all callers of this function will know that the task exists and will have NodeData::Task attached to it. If that was not the case, we would return Option<&T> instead. Similarly, get_or_create_file_node and get_file_path do the same for files. Finally, task_has_output, get_task_output, and set_task_output manipulate the task outputs in NodeData::Task. We store the task output so we can retrieve it when we do not need to execute the task. When a task is added to the dependency graph, it does not have an output yet, so use Option<O> to store the output and pass in None. Now we have enough scaffolding in Store to start scaffolding TopDownContext. We have not done anything with edges yet, but will get back to that later. Top-down context basics Add the top_down module to src/context/mod.rs: Create the src/context/top_down.rs file and add the following to get started: use std::fs::File;
use std::io;
use std::path::Path; use crate::{Context, Task};
use crate::dependency::FileDependency;
use crate::stamp::{FileStamper, OutputStamper};
use crate::store::{Store, TaskNode}; pub struct TopDownContext<T, O> { store: Store<T, O>,
} impl<T: Task> TopDownContext<T, T::Output> { pub fn new(store: Store<T, T::Output>) -> Self { Self { store } } pub fn require(&mut self, task: &T) -> T::Output { let output = self.require_task(task); output }
} impl<T: Task> Context<T> for TopDownContext<T, T::Output> { fn require_task_with_stamper(&mut self, task: &T, stamper: OutputStamper) -> T::Output { let node = self.store.get_or_create_task_node(task); todo!("figure out what the currently executing task is"); todo!("add task dependency to store"); let output = if self.should_execute_task(&node, task) { let output = task.execute(self); self.store.set_task_output(&node, output); } else { self.store.get_task_output(&node).clone() }; output } fn require_file_with_stamper<P: AsRef<Path>>(&mut self, path: P, stamper: FileStamper) -> Result<Option<File>, io::Error> { let path = path.as_ref(); let (dependency, file) = FileDependency::new(path, stamper)?; let node = self.session.store.get_or_create_file_node(path); todo!("figure out what the currently executing task is"); todo!("add file dependency to store"); Ok(file) }
} impl<T: Task> TopDownContext<T, T::Output> { fn should_execute_task(&mut self, node: &TaskNode, task: &T) -> bool { todo!("figure out if we should execute the task"); }
}

