Since we want users of the build system to implement their own tasks, we will define Task as a trait. Likewise, we will also be implementing multiple contexts in this tutorial, so we will also define Context as a trait. Add the following code to your src/lib.rs file: use std::fmt::Debug;
use std::hash::Hash; pub trait Task: Clone + Eq + Hash + Debug { type Output: Clone + Eq + Debug; fn execute<C: Context<Self>>(&self, context: &mut C) -> Self::Output;
} pub trait Context<T: Task> { fn require_task(&mut self, task: &T) -> T::Output;
} Note If this seems overwhelming to you, don't worry. We will go through the API and explain things. But more importantly, the API should become more clear once we implement it in the next section and subsequent chapters. Furthermore, if you're new to Rust and/or need help understanding certain concepts, I will try to explain them in Rust Help blocks. They are collapsed by default to reduce distraction, clicking the header opens them. See the first Rust Help block at the end of this section. The Task trait has several supertraits that we will need later in the tutorial to implement incrementality: Eq and Hash: to check whether a task is equal to another one, and to create a hash of it, so we can use a HashMap to get the output of a task if it is up-to-date. Clone: to create a clone of the task so that we can store it in the HashMap without having ownership of it. Debug: to format the task for debugging purposes. A Task has a single method execute, which takes a reference to itself (&self), and a mutable reference to a context (context: &mut C), and produces a value of type Self::Output. Because Context is a trait, we use generics (<C: Context<Self>>) to have execute work for any Context implementation (ignoring the Self part for now). The execute method takes self by reference such that a task can access its data, but not mutate it, as that could throw off incrementality by changing the hash/equality of the task. Finally, the type of output of a task is defined by the Output associated type, and this type must implement Clone, Eq, and Debug for the same reason as Task. The Context trait is generic over Task, allowing it to work with any task implementation. It has a single method require_task for creating a dependency to a task and returning its up-to-date result. It takes a mutable reference to itself, enabling dependency tracking and caching, which require mutation. Because of this, the context reference passed to Task::execute is also mutable. This Task and Context API mirrors the mutually recursive definition of task and context we discussed earlier, and forms the basis for the entire build system. Build the project by running cargo build. The output should look something like: Compiling pie v0.1.0 (/private/var/folders/24/8k48jl6d249_n_qfxwsl6xvm0000gn/T/.tmpLXzvaR/pie) Finished dev [unoptimized + debuginfo] target(s) in 0.15s Rust Help The Rust Programming Language is an introductory book about Rust. I will try to provide links to the book where possible. Rust has a module system for project organization. The lib.rs file is the "main file" of a library. Later on, we will be creating more modules in different files. Things are imported into the current scope with use statements. We import the Debug and Hash traits from the standard library with two use statements. Use statements use paths to refer to nested things. We use :: for nesting, similar to namespaces in C++. Rust models the concept of ownership to enable memory safety without a garbage collector. The execute method accepts a reference to the current type, indicated with &: &self. This reference is immutable , meaning that we can read data from it, but not mutate it. In Rust, things are immutable by default. On the other hand, execute accepts a mutable reference to the context, indicated with &mut: context: &mut C, which does allow mutation. Traits are the main mechanism for open extensibility in Rust. They are comparable to interfaces in class-oriented languages. We will implement a context and tasks in the next section. Supertraits are a kind of inheritance. The : Clone + Eq + Hash + Debug part of the Task trait means that every Task implementation must also implement the Clone, Eq, Hash, and Debug traits. These traits are part of the standard library: Clone for duplicating values. Eq for equality comparisons, along with PartialEq. Hash for turning a value into a hash. Debug for formatting values in a programmer-facing debugging context. Clone and Eq are so com