To support file dependencies, add a method to the Context trait in src/lib.rs: use std::fmt::Debug;
+use std::fs::File; use std::hash::Hash;
+use std::io;
+use std::path::Path; mod context; pub trait Task: Clone + Eq + Hash + Debug { type Output: Clone + Eq + Debug;
@@ -8,6 +11,7 @@ fn execute<C: Context<Self>>(&self, context: &mut C) -> Self::Output; } pub trait Context<T: Task> { fn require_task(&mut self, task: &T) -> T::Output;
+ fn require_file<P: AsRef<Path>>(&mut self, path: P) -> Result<Option<File>, io::Error>; } require_file is similar to requiring a task, but instead takes a path to a file or directory on the filesystem as input. We use AsRef<Path> as the type for the path, so that we can pass anything in that can dereference to a path. For example, str has an AsRef<Path> implementation, so we can just use "test.txt" as a path. As an output, we return Result<Option<File>, io::Error>, with File being a handle to an open file. The reason for this complicated type is: An incremental context will want to read the metadata (such as the last modified date) of the file, or create a hash over the file, to be able to detect changes. Because getting metadata or reading the file can fail, and we want to propagate this error, we return a Result with io::Error as the error type. Tasks can create a dependency to a file that does not exist, and the existence of that file affects the task. For example, a task that prints true or false based on if a file exists. If the file does not exist (or it is a directory), we cannot open it, so we cannot return a File, hence we use Option<File> to return None. Otherwise, we return Ok(Some(file)) so that the task can read the opened file. Rust Help Recoverable error handling in Rust is done with the Result<T, E> type, which can either be Ok(t) or Err(e). In contrast to many languages which use exceptions, throwing, and exception handling; Rust treats recoverable errors just as regular values. Similarly, optional values in Rust are defined using the Option<T> type, which can either be Some(t) or None. Rust has many traits for converting values or references into others, which provides a lot of convenience in what would otherwise require a lot of explicit conversions. AsRef<T> is such a conversion trait, that can convert itself into &T. Here, we use AsRef<Path> as a generic with a trait bound to support many different kinds of values to the path argument in require_file. For example, we can call context.require_file("test.txt") because str, which is the type of string constants, implements AsRef<Path>. You can also see this as a kind of method overloading, without having to provide concrete overloads for all supported types. Now we need to implement this method for NonIncrementalContext. However, because we will be performing similar file system operations in the incremental context as well, we will create some utility functions for this first. Add the fs module to src/lib.rs: use std::hash::Hash; use std::io; use std::path::Path; mod context;
+mod fs; pub trait Task: Clone + Eq + Hash + Debug { type Output: Clone + Eq + Debug; fn execute<C: Context<Self>>(&self, context: &mut C) -> Self::Output; } Create file src/fs.rs with: use std::{fs, io};
use std::fs::{File, Metadata};
use std::path::Path; /// Gets the metadata for given `path`, or `Err(e)` if there was an error getting the metadata, or `Ok(None)` if no file
/// or directory exists at given `path`.
pub fn metadata(path: impl AsRef<Path>) -> Result<Option<Metadata>, io::Error> { match fs::metadata(path) { Err(e) if e.kind() == io::ErrorKind::NotFound => Ok(None), Err(e) => Err(e), Ok(m) => Ok(Some(m)) }
} /// Open file at given `path` if it exists and is a file. This is necessary because on Windows, opening a directory
/// returns an error.
pub fn open_if_file(path: impl AsRef<Path>) -> Result<Option<File>, io::Error> { let file = match metadata(&path)? { Some(metadata) if metadata.is_file() => Some(File::open(&path)?), _ => None, }; Ok(file)
} The comments explain the behaviour. We will write some tests to confirm the behaviour, but for that we need a utility to create temporary files and directories. Instead of implementing that ourselves, we will use an existing crate. Add the tempfile dependency to Cargo.toml: name = "pie" version = "0.1.0" edition = "2021" [workspace]
+
+[dev-dependencies]
+tempfile = "3" Note that this is dependency is added under dev-dependencies, indicating that this dependency is only available when running tests, benchmarks, and examples. Therefore, users of our library will not depend on this library, which is good because temporary file creation is not necessary to users of our library. Now, add the following tests to src/fs.rs: #[cfg(test)]
mod test { use std::fs::remove_file; use tempfile::{NamedTempFile, TempDir, TempPath}; use super::*; #[test] fn test_metadata_ok() { let path = create_temp_path(); let metadata = metadata(path); assert!(metadata.is_ok()); let metadata = metadata.unwrap(); assert!(metadata.is_some()); let metadata = metadata.unwrap(); assert!(metadata.is_file()); } #[test] fn test_metadata_none() { let path = create_temp_path(); remove_file(&path).expect("failed to delete temporary file"); let metadata = metadata(&path); assert!(metadata.is_ok()); let metadata = metadata.unwrap(); assert!(metadata.is_none()); } #[test] fn test_open_if_file() { let path = create_temp_path(); let file = open_if_file(&path); assert!(file.is_ok()); let file = file.unwrap(); assert!(file.is_some()); } #[test] fn test_open_if_file_non_existent() { let path = create_temp_path(); remove_file(&path).expect("failed to delete temporary file"); let file = open_if_file(&path); assert!(file.is_ok()); let file = file.unwrap(); assert!(file.is_none()); } #[test] fn test_open_if_file_on_directory() { let dir = TempDir::new().expect("failed to create temporary directory"); let file = open_if_file(dir.path()); assert!(file.is_ok()); let file = file.unwrap(); assert!(file.is_none()); } fn create_temp_path() -> TempPath { NamedTempFile::new().expect("failed to create temporary file").into_temp_path() }
} The tempfile library takes care of deleting temporary files when they go out of scope (at the end of the test). Unfortunately, we can't easily test when metadata and open_if_file should return an error, because we cannot disable read permissions on files via the Rust standard library. Now we are done with our filesystem utility excursion. Make the non-incremental context compatible by changing src/context/non_incremental.rs: +use std::fs::File;
+use std::io;
+use std::path::Path;
+ use crate::{Context, Task};
+use crate::fs::open_if_file; pub struct NonIncrementalContext; impl<T: Task> Context<T> for NonIncrementalContext { fn require_task(&mut self, task: &T) -> T::Output { task.execute(self) }
+ fn require_file<P: AsRef<Path>>(&mut self, path: P) -> Result<Option<File>, io::Error> {
+ let file = open_if_file(&path)?;
+ Ok(file)
+ } } Since the non-incremental context does not track anything, we simply try to open the file and return it. This implements the description we made earlier: If opening the file results in an error, the ? operator returns Err(...) immediately. If the file does not exist or is a directory, open_if_file returns None and file is None. Otherwise, file is Some(file). Confirm everything works with cargo test. Rust Help The ? operator makes it easy to propgate errors. Because errors are just values in Rust, to propgate an error, you'd normally have to match each result and manually propagate the error. The r? operator applied to a Result r does this for you, it basically desugars to something like match r { Err(e) => return Err(e), _ => {} }. Comments with three forward slashes /// are documentation comments that document the function/struct/enum/trait/etc. they are applied to.
